[nitpick] The hardcoded RGB color values and z-index should be extracted into CSS variables or constants to improve maintainability and consistency with the design system.
```suggestion
          // Inject CSS variables for warning colors and z-index
          const style = document.createElement("style");
          style.textContent = `
            :host, :root {
              --auto-mark-warning-z: 2147483647;
              --auto-mark-warning-border: rgb(255,237,213);
              --auto-mark-warning-bg: rgb(255,247,237);
              --auto-mark-warning-text: rgb(154,52,18);
            }
          `;
          container.appendChild(style);

          const wrapper = document.createElement("div");
          container.appendChild(wrapper);
          const root = ReactDOM.createRoot(wrapper);

          root.render(
            <div className="-translate-x-1/2 fixed top-5 left-1/2 z-[var(--auto-mark-warning-z)] flex transform gap-2.5 rounded-md border-2 border-[var(--auto-mark-warning-border)] bg-[var(--auto-mark-warning-bg)] p-4 font-bold text-[var(--auto-mark-warning-text)]">
